bel for=\"inputMail\">Эл. почта:</label>\r\n	</div>\r\n	<div class=\"col-sm-8 col-md-9\">\r\n		[email inputMail id:inputMail placeholder \"your@mail.com\"]\r\n	</div>\r\n</div>\r\n<div class=\"row\">\r\n	<div class=\"col-sm-4 col-md-3\">\r\n		<label for=\"inputToDo\">Что нужно сделать?</label>\r\n	</div>\r\n	<div class=\"col-sm-8 col-md-9\">\r\n		[textarea inputToDo id:inputToDo x4 placeholder \"Что нужно сделать?\"]\r\n	</div>\r\n</div>							\r\n<div>[submit class:button \"Отправить\"]</div>\nСкорая компьютерная помощь Плюс \"[your-subject]\"\n[your-name] <wordpress@vagrant.local>\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n--\r\nThis e-mail was sent from a contact form on Скорая компьютерная помощь Плюс (http://vagrant.local)\n\nReply-To: [your-email]\n\n\n\n\nСкорая компьютерная помощь Плюс \"[your-subject]\"\nСкорая компьютерная помощь Плюс <wordpress@vagrant.local>\nMessage Body:\r\n[your-message]\r\n\r\n--\r\nThis e-mail was sent from a contact form on Скорая компьютерная помощь Плюс (http://vagrant.local)\n[your-email]\nReply-To: admin@example.com\n\n\n\nСпасибо за Вашу заявку! Мы обязательно свяжемся с Вами!\nПри отправке сообщения произошла ошибка! Пожалуйста, повторите попытку позже.\nОдно или несколько полей содержат ошибки!\nПри отправке сообщения произошла ошибка! Пожалуйста, повторите попытку позже.\nYou must accept the terms and conditions before sending your message.\nЭто поле обязательно для заполнения.\nПревышена допустимая длина ввода.\nДлина ввода меньше допустимого.\nФормат даты неверен.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nПри отправке файла произошла ошибка.\nВам не разрешено загружать файлы такого типа.\nФайл слишком большой.\nПри отправке файла произошла ошибка.\nНеверный формат числа.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nНеверный адрес электронной почты.\nОшибка в ссылке.\nНеверный номер телефона.\ndemo_mode: on','Оформить заявку','','publish','closed','closed','','untitled','','','2016-08-24 11:48:33','2016-08-24 07:48:33','',0,'http://vagrant.local/?post_type=wpcf7_contact_form&#038;p=25',0,'wpcf7_contact_form','',0),(26,1,'2016-08-23 13:45:52','2016-08-23 09:45:52','','Оформить заявку','','publish','closed','closed','','request','','','2016-08-24 09:36:36','2016-08-24 05:36:36','',0,'http://vagrant.local/?page_id=26',0,'page','',0),(27,1,'2016-08-23 13:45:52','2016-08-23 09:45:52','[contact-form-7 id=\"25\" title=\"Untitled\"]','Тест','','inherit','closed','closed','','26-revision-v1','','','2016-08-23 13:45:52','2016-08-23 09:45:52','',26,'http://vagrant.local/26-revision-v1/',0,'revision','',0),(28,1,'2016-08-24 09:36:36','2016-08-24 05:36:36','','Оформить заявку','','inherit','closed','closed','','26-revision-v1','','','2016-08-24 09:36:36','2016-08-24 05:36:36','',26,'http://vagrant.local/26-revision-v1/',0,'revision','',0),(29,1,'2016-08-25 10:04:44','2016-08-25 06:04:44','','Контакты','','publish','closed','closed','','contacts','','','2016-08-25 10:04:44','2016-08-25 06:04:44','',0,'http://vagrant.local/?page_id=29',0,'page','',0),(30,1,'2016-08-25 10:04:44','2016-08-25 06:04:44','','Контакты','','inherit','closed','closed','','29-revision-v1','','','2016-08-25 10:04:44','2016-08-25 06:04:44','',29,'http://vagrant.local/29-revision-v1/',0,'revision','',0),(31,1,'2016-08-25 10:05:58','2016-08-25 06:05:58',' ','','','publish','closed','closed','','31','','','2016-08-25 10:05:58','2016-08-25 06:05:58','',0,'http://vagrant.local/31/',6,'nav_menu_item','',0),(32,1,'2016-08-25 10:08:26','2016-08-25 06:08:26','С помощью этой формы Вы можете задать нам любой вопрос. Заполните необходимые поля и нажмите кнопку \"Отправить\". Мы ответим Вам как можно скорее!\r\n<div class=\"row\">\r\n	<div class=\"col-sm-4 col-md-3\">\r\n		<label for=\"inputName\">Ваше имя: